import React from 'react';
import { useLocation } from 'react-router-dom';

function Page2() {
    const location = useLocation();
    const { works } = location.state || { works: [] }; // Page1에서 전달받은 작품 정보

    return (
        <div>
            <h1>작품 미리보기</h1>
            {works.map((work, index) => (
                <div key={index}>
                    <h2>{work.videoName}</h2>
                    {/* 비디오 미리보기 */}
                    {work.videoFile && (
                        <video controls width="300" src={work.videoUrl}>
                            Your browser does not support the video tag.
                        </video>
                    )}
                </div>
            ))}
        </div>
    );
}

export default Page2;
